import React, { useEffect, useState } from "react";
import axios from "axios";
import {
    Table,
    TableHead,
    TableBody,
    TableRow,
    TableCell,
    TableContainer,
    Paper,
    Button,
    Select,
    MenuItem,
    FormHelperText,
    FormControl
} from "@material-ui/core";
import { Link } from "react-router-dom";
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    formControl: {
        margin: theme.spacing(1),
        minWidth: 120,
    },
    selectEmpty: {
        marginTop: theme.spacing(2),
    },
}));

const Medical = () => {
    const classes = useStyles();
    const [states, setStates] = useState([]);
    const [q, setQ] = useState("");
    const getData = async () => {
        try {
            const data = await axios.get(
                "https://api.rootnet.in/covid19-in/hospitals/medical-colleges"
            );
            console.log(data.data.data.medicalColleges);
            setStates(data.data.data.medicalColleges);
        } catch (e) {
            console.log(e);
        }
    };

    useEffect(() => {
        getData();
    }, []);

    const mySet = new Set(states)

    return (
        <>
            <section id="contact">
                <div className="container">
                    <div className="heading">
                        <h1>Medical Colleges & beds</h1>
                        <Link to="/">
                            <Button variant="contained" color="primary">
                                Go Back
              </Button>
                        </Link>
                    </div>
                    <FormControl className={classes.formControl}>
                        <Select
                            value={q}
                            onChange={(e) => { setQ(e.target.value) }}
                        >
                            <MenuItem value="">
                                <em>None</em>
                            </MenuItem>
                            {
                                mySet(states).map((row) => (
                                    <MenuItem value={row.state}>{row.state}</MenuItem>
                                ))}
                        </Select>
                        <FormHelperText>Some important helper text</FormHelperText>
                    </FormControl>
                    {/* <TextField label="Type" variant="outlined" /> */}
                    <TableContainer component={Paper}>
                        <Table>
                            <TableHead>
                                <TableRow>
                                    <TableCell>State Name</TableCell>
                                    <TableCell>Institute Name</TableCell>
                                    <TableCell>City</TableCell>
                                    <TableCell>Type</TableCell>
                                    <TableCell>Admission Capacity</TableCell>
                                    <TableCell>Hospital Beds</TableCell>
                                </TableRow>
                            </TableHead>
                            <TableBody>
                                {states.map((row) => (
                                    <TableRow key={row.state}>
                                        <TableCell>{row.state}</TableCell>
                                        <TableCell>{row.name}</TableCell>
                                        <TableCell>{row.city}</TableCell>
                                        <TableCell>{row.ownership}</TableCell>
                                        <TableCell>{row.admissionCapacity}</TableCell>
                                        <TableCell>{row.hospitalBeds}</TableCell>
                                    </TableRow>
                                ))}
                            </TableBody>
                        </Table>
                    </TableContainer>
                </div>
            </section>
        </>
    );
};

export default Medical;
